import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import GridList from '@material-ui/core/GridList'
import GridListTile from '@material-ui/core/GridListTile'
import GridListTileBar from '@material-ui/core/GridListTileBar'
import ListSubheader from '@material-ui/core/ListSubheader'
import InfoIcon from '@material-ui/icons/Info'
import PropTypes from 'prop-types'
import withStyles from '@material-ui/core/styles/withStyles'
import { I18n } from 'react-redux-i18n'
import {
    IconButton,
    Icon,
    Tooltip,
    Button,
    Card,
    Grid,
    CardContent,
    CardActions,
    Typography,
    AppBar,
    Toolbar,
    Hidden,

} from '@material-ui/core'
import StarBorderIcon from '@material-ui/icons/StarBorder'
import { titles } from '../../constants/index';
import moment from 'moment'
import _ from 'lodash'

const styles = theme => ({
    root: {

    },
})


class Actions extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
        }
    }

    render() {
        let { classes } = this.props
        return (
            <Grid container spacing={0} style={{ height: 40, width: '100%' }}>
                <Grid item xs={12} style={{ padding: '8px 80px', fontWeight: 500 }}>
                    {titles.map((item, index) => {
                        return (
                            <Typography key={index} style={{ display: 'inline', color: '#1976d2', fontSize: 16, padding: '0 10px', border: '2px solid red' }}>
                                {item.title}
                            </Typography>
                        )
                    })}
                </Grid>
            </Grid>
        )
    }
}

Actions.propTypes = {
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Actions);
